<!DOCTYPE html>
<html>
  <head>
    <meta charset="utf-8" />
    <meta name="viewport" content="initial-scale=1, width=device-width" />

    <link rel="stylesheet" href="./global.css" />
    <link rel="stylesheet" href="./android-large-9.css" />
    <link
      rel="stylesheet"
      href="https://fonts.googleapis.com/css2?family=Montserrat:wght@400;500;600;700&display=swap"
    />
    <link
      rel="stylesheet"
      href="https://fonts.googleapis.com/css2?family=Quicksand:wght@600&display=swap"
    />
    <link
      rel="stylesheet"
      href="https://fonts.googleapis.com/css2?family=Roboto:wght@600&display=swap"
    />
  </head>
  <body>
    <div class="android-large-9">
      <div class="android-large-9-child"></div>
      <div class="android-large-9-item"></div>
      <div class="line-parent">
        <div class="frame-child"></div>
        <div class="frame-item"></div>
      </div>
      <div class="android-large-9-inner"></div>
      <section class="frame-section">
        <div class="frame-parent">
          <header class="frame-group">
            <div class="time-parent">
              <div class="time">9:41</div>
              <div class="chevron-left-wrapper">
                <img
                  class="chevron-left-icon"
                  alt=""
                  src="./public/chevronleft.svg"
                />
              </div>
            </div>
            <div class="frame-wrapper">
              <div class="frame-container">
                <div class="frame-div">
                  <div class="workout-schedule-parent">
                    <h2 class="workout-schedule">Workout Schedule</h2>
                    <div class="calendar-background-wrapper">
                      <div class="calendar-background">
                        <div class="vector-wrapper">
                          <img
                            class="vector-icon"
                            loading="lazy"
                            alt=""
                            src="./public/vector.svg"
                          />
                        </div>
                        <div class="feb-2024">Feb 2024</div>
                        <div class="vector-container">
                          <img
                            class="vector-icon1"
                            loading="lazy"
                            alt=""
                            src="./public/vector-1.svg"
                          />
                        </div>
                      </div>
                    </div>
                  </div>
                </div>
                <div class="frame-parent1">
                  <div class="cellular-connection-wrapper">
                    <img
                      class="cellular-connection-icon"
                      loading="lazy"
                      alt=""
                      src="./public/cellular-connection.svg"
                    />
                  </div>
                  <img
                    class="wifi-icon"
                    loading="lazy"
                    alt=""
                    src="./public/wifi.svg"
                  />

                  <div class="battery">
                    <div class="border"></div>
                    <img
                      class="cap-icon"
                      loading="lazy"
                      alt=""
                      src="./public/cap.svg"
                    />

                    <div class="capacity"></div>
                  </div>
                </div>
              </div>
            </div>
          </header>
          <div class="calendar-wrapper">
            <div class="calendar">
              <div class="day-labels-parent">
                <div class="day-labels"></div>
                <div class="sun-5">
                  <p class="sun">Sun</p>
                  <p class="p">5</p>
                </div>
              </div>
              <div class="calendar-inner">
                <div class="rectangle-parent">
                  <div class="frame-inner"></div>
                  <div class="mon-6">
                    <p class="mon">Mon</p>
                    <p class="p1">6</p>
                  </div>
                </div>
              </div>
              <div class="rectangle-group">
                <div class="rectangle-div"></div>
                <div class="tue-7-wrapper">
                  <div class="tue-7">
                    <p class="tue">Tue</p>
                    <p class="p2">7</p>
                  </div>
                </div>
                <img class="assignment-ind-icon" loading="lazy" alt="" />
              </div>
              <div class="rectangle-container">
                <div class="frame-child1"></div>
                <div class="wed-8">
                  <p class="wed">Wed</p>
                  <p class="p3">8</p>
                </div>
              </div>
              <div class="group-div">
                <div class="frame-child2"></div>
                <div class="thu-9">
                  <p class="thu">Thu</p>
                  <p class="p4">9</p>
                </div>
              </div>
            </div>
          </div>
        </div>
      </section>
      <div class="rectangle"></div>
      <section class="frame-parent2">
        <div class="am-wrapper">
          <div class="am">06:00 AM</div>
        </div>
        <div class="line-group">
          <div class="line-div"></div>
          <div class="frame-parent3">
            <div class="frame-parent4">
              <div class="time-separator-wrapper">
                <div class="time-separator">
                  <div class="am-parent">
                    <div class="am1">07:00 AM</div>
                    <div class="am2">08:00 AM</div>
                  </div>
                  <div class="a-mlabel-wrapper">
                    <div class="a-mlabel">
                      <div class="a-mlabel-child"></div>
                      <div class="ab-workout-730am">Ab Workout, 7:30am</div>
                    </div>
                  </div>
                </div>
              </div>
              <div class="frame-child3"></div>
            </div>
            <div class="frame-wrapper1">
              <div class="frame-parent5">
                <div class="circleicon-parent">
                  <div class="circleicon">
                    <div class="circleicon-child"></div>
                  </div>
                  <div class="lowerworkoutlabel">
                    <div class="am3">09:00 AM</div>
                    <div class="am-container">
                      <div class="am4">10:00 AM</div>
                    </div>
                  </div>
                </div>
                <div class="upperandlowerworkouts">
                  <div class="upperandlowerworkouts-child"></div>
                  <div class="upperbody-workout-9am">
                    Upperbody Workout, 9am
                  </div>
                </div>
              </div>
            </div>
          </div>
          <div class="frame-child4"></div>
        </div>
        <div class="am-frame">
          <div class="am5">11:00 AM</div>
        </div>
        <div class="frame-child5"></div>
        <div class="frame-parent6">
          <div class="frame-parent7">
            <input class="frame-input" placeholder="12:00 AM" type="text" />

            <div class="frame-child6"></div>
          </div>
          <div class="frame-parent8">
            <div class="am-wrapper1">
              <div class="am6">01:00 AM</div>
            </div>
            <div class="line-container">
              <div class="frame-child7"></div>
              <div class="frame-wrapper2">
                <div class="frame-parent9">
                  <div class="am-wrapper2">
                    <div class="am7">02:00 AM</div>
                  </div>
                  <div class="rectangle-parent1">
                    <div class="frame-child8"></div>
                    <div class="lowerbody-workout-3pm">
                      Lowerbody Workout, 3pm
                    </div>
                  </div>
                </div>
              </div>
            </div>
          </div>
          <div class="frame-child9"></div>
          <div class="frame-wrapper3">
            <div class="frame-parent10">
              <div class="frame-wrapper4">
                <div class="frame-parent11">
                  <div class="am-wrapper3">
                    <div class="am8">03:00 AM</div>
                  </div>
                  <div class="am9">04:00 AM</div>
                </div>
              </div>
              <div class="wrapper-group-6-parent">
                <div class="wrapper-group-6">
                  <img
                    class="wrapper-group-6-child"
                    loading="lazy"
                    alt=""
                    src="./public/group-6.svg"
                  />
                </div>
                <h1 class="h1">+</h1>
              </div>
            </div>
          </div>
          <div class="frame-child10"></div>
        </div>
        <div class="am-wrapper4">
          <div class="am10">05:00 AM</div>
        </div>
        <div class="frame-child11"></div>
        <footer class="wrapper-group-1-parent">
          <div class="wrapper-group-1">
            <img
              class="wrapper-group-1-child"
              loading="lazy"
              alt=""
              src="./public/group-1.svg"
            />
          </div>
          <button class="frame-button">
            <div class="frame-child12"></div>
            <img class="group-icon" alt="" src="./public/group-5.svg" />
          </button>
        </footer>
      </section>
    </div>
  </body>
</html>
